import React from 'react'

let Menu = () => {
    return (
        <div className='containerMenu'>
            <div>My profile</div>
            <div>Feed</div>
            <div>Messages</div>
            <div>Videos</div>
            <div>Settings</div>
        </div>
    )
}

export default Menu;
